import React from "react";
import "./App.css";
import { Routes, Route } from "react-router-dom";
import Home from "./home";
import About from "./about";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>
        <Route path='/about' element={<About/>}></Route>
      </header>
    </div>
  );
}

export default App;
